// src/components/Footer.js
import React from "react";
import {
  Box,
  Typography,
  Grid,
  TextField,
  Button,
  IconButton,
  Link // Added Link for better semantic links
} from "@mui/material";
import FacebookIcon from "@mui/icons-material/Facebook";
import InstagramIcon from "@mui/icons-material/Instagram";
import TwitterIcon from "@mui/icons-material/Twitter";
import PinterestIcon from "@mui/icons-material/Pinterest";

// --- DARKER PINK PALETTE ---
const darkPinkTheme = {
  // Darker Pink for background and major elements
  mainBackground: '#F8BBD0', // Light Pink (Paler, less white)
  gradientStart: '#E91E63', // Deep Pink
  gradientEnd: '#FF4081',   // Bright Pink
  // Darker Text and accents
  textColor: '#4A148C',      // Deep Purple/Berry for strong contrast
  hoverColor: '#D81B60',     // Darker Hot Pink
  lightAccent: '#FCE4EC',   // Very light pink for component backgrounds
};
// ----------------------------

export default function Footer() {
  const currentYear = new Date().getFullYear();

  // Helper component for styled links
  const NavLink = ({ children, to }) => (
    <Link 
      href={to} 
      underline="none" 
      color="inherit" 
      variant="body2" 
      sx={{ 
        cursor: "pointer", 
        mb: 0.5, 
        display: 'block', // Ensures each link is on its own line
        transition: 'color 0.2s',
        "&:hover": { color: darkPinkTheme.hoverColor, fontWeight: 600 } 
      }}
    >
      {children}
    </Link>
  );

  return (
    <Box
      sx={{
        mt: 8,
        p: 6,
        // Using a darker, more saturated pink gradient
        background: `linear-gradient(180deg, ${darkPinkTheme.mainBackground}, #f3d4db)`, 
        color: darkPinkTheme.textColor, // Using a deep purple/berry color for text
        fontFamily: "'Quicksand', sans-serif",
        borderTop: `5px solid ${darkPinkTheme.gradientEnd}`, // Added a bold top border
      }}
    >
      <Grid container spacing={4} justifyContent="space-between">
        
        {/* 1. About Section */}
        <Grid item xs={12} sm={6} md={3}>
          <Typography 
            variant="h5" // Slightly larger title
            sx={{ 
              mb: 2, 
              fontFamily: "'Sacramento', cursive", 
              fontSize: "2rem", 
              color: darkPinkTheme.gradientEnd, // Bright Pink logo text
              fontWeight: 'bold'
            }}
          >
            SweetCraft üßÅ
          </Typography>
          <Typography variant="body2">
            Handcrafted desserts made with love! Customize your waffles, pancakes, pastries, cookies, bento cakes & more.
          </Typography>
        </Grid>

        {/* 2. Quick Links */}
        <Grid item xs={12} sm={6} md={2}>
          <Typography variant="h6" sx={{ mb: 2, fontWeight: 700 }}>
            Quick Links
          </Typography>
          {/* Using the styled NavLink component */}
          <NavLink to="/">Home</NavLink>
          <NavLink to="/categories">Categories</NavLink>
          <NavLink to="/orders">My Orders</NavLink>
          <NavLink to="/contact">Contact</NavLink>
        </Grid>

        {/* 3. Newsletter */}
        <Grid item xs={12} sm={6} md={4}>
          <Typography variant="h6" sx={{ mb: 2, fontWeight: 700 }}>
            Newsletter üíå
          </Typography>
          <Typography variant="body2" sx={{ mb: 2 }}>
            Subscribe for updates, special offers & **sweet surprises**!
          </Typography>
          <Box display="flex" gap={1}>
            <TextField
              placeholder="Your email"
              size="small"
              variant="outlined" // Use outlined variant for a cleaner look
              InputProps={{ 
                sx: { 
                    backgroundColor: darkPinkTheme.lightAccent, // Very light pink background
                    borderRadius: 2,
                }
              }}
              sx={{ flex: 1 }}
            />
            <Button
              variant="contained"
              // Using the darker pink gradient for a strong call-to-action
              sx={{
                background: `linear-gradient(45deg, ${darkPinkTheme.gradientStart}, ${darkPinkTheme.gradientEnd})`,
                color: 'white',
                fontWeight: 700,
                '&:hover': { background: darkPinkTheme.hoverColor },
              }}
            >
              Sign Up
            </Button>
          </Box>
        </Grid>

        {/* 4. Social / Contact */}
        <Grid item xs={12} sm={6} md={3}>
          <Typography variant="h6" sx={{ mb: 2, fontWeight: 700 }}>
            Connect With Us
          </Typography>
          <Box display="flex" gap={1}>
            {/* Darker pink social icons */}
            <IconButton sx={{ color: darkPinkTheme.gradientEnd }}><FacebookIcon /></IconButton>
            <IconButton sx={{ color: darkPinkTheme.gradientEnd }}><InstagramIcon /></IconButton>
            <IconButton sx={{ color: darkPinkTheme.gradientEnd }}><TwitterIcon /></IconButton>
            <IconButton sx={{ color: darkPinkTheme.gradientEnd }}><PinterestIcon /></IconButton>
          </Box>
          <Typography variant="body2" sx={{ mt: 2, fontWeight: 600 }}>
            Email: <Link href="mailto:support@sweetcraft.com" color="inherit" underline="hover">support@sweetcraft.com</Link>
          </Typography>
          <Typography variant="body2" sx={{ fontWeight: 600 }}>
            Phone: +91 98765 43210
          </Typography>
        </Grid>
      </Grid>

      {/* Copyright Bar */}
      <Box sx={{ textAlign: "center", mt: 6, borderTop: `1px solid ${darkPinkTheme.hoverColor}`, pt: 3 }}>
        <Typography variant="body2" sx={{ color: darkPinkTheme.textColor, fontWeight: 500 }}>
          ¬© {currentYear} SweetCraft. All rights reserved. Made with love.
        </Typography>
      </Box>
    </Box>
  );
}
